import React from "react";
export default function Circle() {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" width="100" height="100" viewBox="0 0 100 100">
            <circle cx="100" cy="100" r="50" stroke-width="5" stroke="#231e28" fill="none" />
  </svg>
  );
}
